import React from "react";
import AlbumsList from "../albumsList/trackList";
import "./artist.scss";

class Artist extends React.Component {
  render() {
    return (
      <>
        <AlbumsList
          data_artist={this.props.data_content.recently}
          playMusic_artist={this.props.playMusic_content}
          play_artist={this.props.play_content}
        ></AlbumsList>
        <AlbumsList
          data_artist={this.props.data_content.all}
          playMusic_artist={this.props.playMusic_content}
          play_artist={this.props.play_content}
        ></AlbumsList>
      </>
    );
  }
}

export default Artist;
